=head1 DESCRIPTION

A filter condition that specifies the object age range of included
objects in days. Only integers are supported.

=head1 ATTRIBUTES


=head2 DaysGreaterThan => Int

Specifies the maximum object age in days. Must be a positive whole
number, greater than the minimum object age and less than or equal to
2,147,483,647.


=head2 DaysLessThan => Int

Specifies the minimum object age in days. The value must be a positive
whole number, greater than 0 and less than or equal to 2,147,483,647.



